column8:
■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><br /><tr><br /><td><br /><font color="#333333" size="-1">AFCの人気商品でもある従来品のブルーベリー＆ルテインより、さらにパワーアップ!北欧に自生する野生種ブルーベリーのエキスは、その成分を国内分析し、基準をクリアした原料だけを100％使用。さらに、ブルーベリーエキスは20％アップの240mg、ルテインを従来品のなんと6倍、12mgで大幅増量!従来のブルーベリールテインがDHAとβ-カロテンとの嬉しい組合せで登場です!</font><br /></td><br /></tr><br /></table><br /><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><br /><tr bgcolor="#FFFFFF"><br /><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><br /><td width="75%" align="left"><font color="#333333" size="-1">300mg×60粒</font></td><br /></tr><br /><tr bgcolor="#FFFFFF"><br /><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><br /><td align="left"><font color="#333333" size="-1">個装サイズ：9×5×5cm</font><br /></td><br /></tr><br /><tr bgcolor="#FFFFFF"><br /><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><br /><td align="left"><font color="#333333" size="-1">53g</font><br><font color="#333333" size="-1">個装重量：53g</font></td><br /></tr><br /><tr bgcolor="#FFFFFF"><br /><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><br /><td align="left"><br /><font color="#333333" size="-1">商品区分：健康食品</font><br><br /><font color="#333333" size="-1">保存方法：高温多湿および直射日光を避け、涼しい所に保存してください。</font><br><br /><font color="#333333" size="-1">賞味期限:製造日より2年</font><br><br /><font color="#333333" size="-1">プラボトル入り</font></td><br /></tr><br /><tr bgcolor="#FFFFFF"><br /><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><br /><td align="left"><font color="#333333" size="-1">日本</font></td><br /></tr><br /></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
